import React, { Component } from 'react';

class Header extends Component {
    render() {
        const myStyles = {
            'backgroundImage': './img/bg-masthead.jpg',
            'height': '300px'
        }
        return (
            <header style={myStyles}>

            </header>
        );
    }
};

export default Header;
